package Relationaloperators;

public class RelationaloperatorsA {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		int a=10;
		int b=20;
		
		System.out.println(a==b);
		System.out.println(a>b);
		System.out.println(a<b);
		System.out.println(a!=b);
		System.out.println(a<=b);
		System.out.print(a>=b);
		
		int x = 10;
		int y = 100;
		
		System.out.println(x==y);
		System.out.println(x != y);
	}

}
